    <g ed:parentid="330" ed:topictype="callout" ed:height="52.8" transform="matrix(1,0,0,1,609.5,131.19)" ed:layout="rightmap" ed:width="540.856" id="339">

    </g>

        </text>
    </g>
    <g ed:parentid="322" ed:height="23.9833" transform="matrix(1,0,0,1,609.51,100.71)" ed:layout="rightmap" ed:width="412.4" id="326">
        <path fill="#ffffff" d="M0,0L412.4,0L412.4,24L0,24L0,0z"/>
        <path stroke-linejoin="round" d="M0,24L412.4,24" fill="none" stroke-width="1.33333" stroke="#454545"/>
        <text class="st12">
            <tspan y="16.1" style="white-space:pre" x="8">重言式（永真式）：命题变元的所有赋值都是命题公式的成真赋值</tspan>
        </text>
    </g>
    <g ed:parentid="322" ed:height="23.9833" transform="matrix(1,0,0,1,609.51,193.52)" ed:layout="rightmap" ed:width="412.4" id="330">
        <path fill="#ffffff" d="M0,0L412.4,0L412.4,24L0,24L0,0z"/>
        <path stroke-linejoin="round" d="M0,24L412.4,24" fill="none" stroke-width="1.33333" stroke="#454545"/>
        <text class="st12">
            <tspan y="16.1" style="white-space:pre" x="8">矛盾式（永假式）：命题变元的所有赋值都是命题公式的成假赋值</tspan>
        </text>
    </g>
    <g ed:parentid="322" ed:height="23.9833" transform="matrix(1,0,0,1,609.51,224)" ed:layout="rightmap" ed:width="262.8" id="334">

        <text class="st12">
            <tspan y="16.1" style="white-space:pre" x="8">可满足式：命题公式至少有一个成真赋值</tspan>
        </text>
    </g>

    <g ed:parentid="353" ed:height="23.9" transform="matrix(1,0,0,1,609.51,254.49)" ed:layout="rightmap" ed:width="183.6" id="359">

    <g ed:parentid="353" ed:height="23.9" transform="matrix(1,0,0,1,609.51,284.88)" ed:layout="rightmap" ed:width="183.6" id="361">

    <g ed:parentid="351" ed:height="23.9" transform="matrix(1,0,0,1,469.31,315.28)" ed:layout="rightmap" ed:width="154" id="363">

        </text>
    </g>
    <g ed:parentid="365" ed:height="23.9" transform="matrix(1,0,0,1,582.31,345.68)" ed:layout="rightmap" ed:width="508.4" id="367">

            <tspan y="16.1" style="white-space:pre" x="8">命题公式 A→B 是重言式时，称 A 逻辑等价于 B，记作 A |=| B ，称作逻辑等价式</tspan>
        </text>
    </g>
    <g ed:parentid="365" ed:height="23.9" transform="matrix(1,0,0,1,582.31,376.08)" ed:layout="rightmap" ed:width="202" id="369">

    </g>
    <g ed:parentid="365" ed:height="23.9" transform="matrix(1,0,0,1,582.31,406.48)" ed:layout="rightmap" ed:width="453.2" id="371">

            <tspan y="16.1" style="white-space:pre" x="8">可以理解为 A 的成真赋值都是 B 的成真赋值</tspan>
        </text>
    </g>
    <g ed:parentid="467" ed:height="23.9" transform="matrix(1,0,0,1,582.31,687.36)" ed:layout="rightmap" ed:width="469.2" id="473">
        <path fill="#ffffff" d="M0,0L469.2,0L469.2,23.9L0,23.9L0,0z"/>
        <path stroke-linejoin="round" d="M0,23.9L469.2,23.9" fill="none" stroke-width="1.33333" stroke="#454545"/>
        <text class="st12">
            <tspan y="16.1" style="white-space:pre" x="8">每个逻辑等价式都可以写成两个逻辑蕴涵式，即 A |=| B 有 A |= B，B |= A</tspan>
        </text>
    </g>
    <g ed:parentid="467" ed:height="23.9833" transform="matrix(1,0,0,1,582.31,717.76)" ed:layout="rightmap" ed:width="414.8" id="475">

        </text>
    </g>

        <path fill="#ffffff" d="M0,0L206,0L206,23.9L0,23.9L0,0z"/>
        <path stroke-linejoin="round" d="M0,23.9L206,23.9" fill="none" stroke-width="1.33333" stroke="#454545"/>
        <text class="st12">
            <tspan y="16.1" style="white-space:pre" x="8">若A |=| B，B |=| C，则A |=| C</tspan>
        </text>
    </g>
    <g ed:parentid="509" ed:height="23.9" transform="matrix(1,0,0,1,731.91,1251.12)" ed:layout="rightmap" ed:width="161.2" id="521">
        <path fill="#ffffff" d="M0,0L161.2,0L161.2,23.9L0,23.9L0,0z"/>
        <path stroke-linejoin="round" d="M0,23.9L161.2,23.9" fill="none" stroke-width="1.33333" stroke="#454545"/>
        <text class="st12">
            <tspan y="16.1" style="white-space:pre" x="8">若A |= B，则¬B |= ¬A</tspan>
        </text>
    </g>
    <g ed:parentid="509" ed:height="23.9" transform="matrix(1,0,0,1,731.91,1281.52)" ed:layout="rightmap" ed:width="198" id="523">
        <path fill="#ffffff" d="M0,0L198,0L198,23.9L0,23.9L0,0z"/>
        <path stroke-linejoin="round" d="M0,23.9L198,23.9" fill="none" stroke-width="1.33333" stroke="#454545"/>
        <text class="st12">
            <tspan y="16.1" style="white-space:pre" x="8">若A |= B，B |= C，则A |= C </tspan>
        </text>
    </g>
    <g ed:parentid="509" ed:height="23.9" transform="matrix(1,0,0,1,731.91,1311.92)" ed:layout="rightmap" ed:width="266" id="525">
        <path fill="#ffffff" d="M0,0L266,0L266,23.9L0,23.9L0,0z"/>
        <path stroke-linejoin="round" d="M0,23.9L266,23.9" fill="none" stroke-width="1.33333" stroke="#454545"/>
        <text class="st12">
            <tspan y="16.1" style="white-space:pre" x="8">若A |=B，A |=| A'，B |=| B'，则A' |= B'</tspan>
        </text>
    </g>
    <g ed:parentid="351" ed:height="23.9833" transform="matrix(1,0,0,1,469.31,1407.91)" ed:layout="rightmap" ed:width="113.2" id="231">
        <path fill="#ffffff" d="M0,0L113.2,0L113.2,24L0,24L0,0z"/>
        <path stroke-linejoin="round" d="M0,24L113.2,24" fill="none" stroke-width="1.33333" stroke="#454545"/>
        <text class="st12">
            <tspan y="16.1" style="white-space:pre" x="8">重言式代入原理</tspan>
        </text>
    </g>
    <g ed:parentid="231" ed:height="42.3" transform="matrix(1,0,0,1,609.51,1342.32)" ed:layout="rightmap" ed:width="514" id="233">
        <path fill="#ffffff" d="M0,0L514,0L514,42.3L0,42.3L0,0z"/>
        <path stroke-linejoin="round" d="M0,42.3L514,42.3" fill="none" stroke-width="1.33333" stroke="#454545"/>
        <text class="st12">
            <tspan y="16.1" style="white-space:pre" x="8">将重言式 A 中的某个命题变元 p 的所有出现都代换为命题公式 B，得到的命题公式</tspan>
            <tspan y="34.5" style="white-space:pre" x="8">记作 A(B/p)，A(B/p) 也是重言式。</tspan>
        </text>
    </g>
    <g ed:parentid="231" ed:height="42.3" transform="matrix(1,0,0,1,609.51,1391.12)" ed:layout="rightmap" ed:width="514" id="235">
        <path fill="#ffffff" d="M0,0L514,0L514,42.3L0,42.3L0,0z"/>
        <path stroke-linejoin="round" d="M0,42.3L514,42.3" fill="none" stroke-width="1.33333" stroke="#454545"/>
        <text class="st12">
            <tspan y="16.1" style="white-space:pre" x="8">重言式A的真值与 p 的取值状况 无关，恒为 t，所以将 p 全部代换后的公式 A(B/</tspan>
            <tspan y="34.5" style="white-space:pre" x="8">p) 的真值也恒为 t</tspan>
        </text>
    </g>
    <g ed:parentid="231" ed:height="23.9" transform="matrix(1,0,0,1,609.51,1455.25)" ed:layout="rightmap" ed:width="45.2" id="237">
        <path fill="#ffffff" d="M0,0L45.2,0L45.2,23.9L0,23.9L0,0z"/>
        <path stroke-linejoin="round" d="M0,23.9L45.2,23.9" fill="none" stroke-width="1.33333" stroke="#454545"/>
        <text class="st12">
            <tspan y="16.1" style="white-space:pre" x="8">注意</tspan>
        </text>
    </g>
    <g ed:parentid="237" ed:height="23.98333250880241" transform="matrix(1,0,0,1,681.71,1439.93)" ed:layout="rightmap" ed:width="222.4" id="239">
        <path fill="#ffffff" d="M0,0L222.4,0L222.4,24L0,24L0,0z"/>
        <path stroke-linejoin="round" d="M0,24L222.4,24" fill="none" stroke-width="1.33333" stroke="#454545"/>
        <text class="st12">
            <tspan y="16.1" style="white-space:pre" x="8">1.仅代换部分出现，本原理不成立</tspan>
        </text>
    </g>
    <g ed:parentid="237" ed:height="23.98333250880241" transform="matrix(1,0,0,1,681.71,1470.41)" ed:layout="rightmap" ed:width="368.8" id="241">
        <path fill="#ffffff" d="M0,0L368.8,0L368.8,24L0,24L0,0z"/>
        <path stroke-linejoin="round" d="M0,24L368.8,24" fill="none" stroke-width="1.33333" stroke="#454545"/>
        <text class="st12">
            <tspan y="16.1" style="white-space:pre" x="8">2.如果 B 中包含了 p 或者 A 中的其它变元，本原理不成立</tspan>
        </text>
    </g>
    <g ed:parentid="351" ed:height="23.9833" transform="matrix(1,0,0,1,469.31,1549.78)" ed:layout="rightmap" ed:width="126.8" id="243">
        <path fill="#ffffff" d="M0,0L126.8,0L126.8,24L0,24L0,0z"/>

        <text class="st12">
            <tspan y="16.1" style="white-space:pre" x="8">命题公式替换原理</tspan>
        </text>
    </g>
    <g ed:parentid="243" ed:height="42.3833" transform="matrix(1,0,0,1,623.11,1500.89)" ed:layout="rightmap" ed:width="514" id="245">
        <path fill="#ffffff" d="M0,0L514,0L514,42.4L0,42.4L0,0z"/>
        <path stroke-linejoin="round" d="M0,42.4L514,42.4" fill="none" stroke-width="1.33333" stroke="#454545"/>
        <text class="st12">
            <tspan y="16.1" style="white-space:pre" x="8">将命题公式 A 中的子公式 C 的部分出现替换为和 C 逻辑等价的公式 D（C╞╡D </tspan>
            <tspan y="34.5" style="white-space:pre" x="8">），得到的命题公式记作 B，则 A╞╡B</tspan>
        </text>
    </g>
    <g ed:parentid="243" ed:height="23.9833" transform="matrix(1,0,0,1,623.11,1549.78)" ed:layout="rightmap" ed:width="424.4" id="247">
        <path fill="#ffffff" d="M0,0L424.4,0L424.4,24L0,24L0,0z"/>
        <path stroke-linejoin="round" d="M0,24L424.4,24" fill="none" stroke-width="1.33333" stroke="#454545"/>
        <text class="st12">
            <tspan y="16.1" style="white-space:pre" x="8">C 和 D（在任何赋值下）等值，所以用 D 替换 C 不会改变 A 的真值</tspan>
        </text>
    </g>
    <g ed:parentid="243" ed:height="23.9833" transform="matrix(1,0,0,1,623.11,1580.26)" ed:layout="rightmap" ed:width="194.8" id="249">

        </text>
    </g>

        <text class="st14">
            <tspan y="16.1" style="white-space:pre" x="8">对赋值进行讨论</tspan>
            <tspan class="st15" style="white-space:pre" x="99">：要证明A╞B，只要证明：A的任意一个成真赋值都是B的成真赋</tspan>
            <tspan class="st15" y="35.3" style="white-space:pre" x="8">值，或者 B的任意一个成假赋值都是A的成假赋值。如果证明了A╞B和B╞A，那么</tspan>
            <tspan class="st15" y="53.7" style="white-space:pre" x="8">就证明了A╞╡B。</tspan>
        </text>
        <g ed:note="&lt;body style=&quot; font-family:'SimSun'; font-size:9pt; font-weight:400; font-style:normal;&quot;>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'微软雅黑';&quot;>对赋值的各种状况进行分类讨论，而不是对每一个赋值讨论&lt;/span>&lt;/p>&lt;/body>">

        </g>
